package hainu.com.adultloan.bean;import cn.bmob.v3.BmobObject;/** * Created by haijun on 2016/4/19. */public class StrategyArticle extends BmobObject {    private String articleId;    private String title;    private String time;    private int readCount;    private String imageUrl;    private String articleUrl;    public String getArticleId() {        return articleId;    }    public void setArticleId(String articleId) {        this.articleId = articleId;    }    public String getTitle() {        return title;    }    public void setTitle(String title) {        this.title = title;    }    public String getTime() {        return time;    }    public void setTime(String time) {        this.time = time;    }    public int getReadCount() {        return readCount;    }    public void setReadCount(int readCount) {        this.readCount = readCount;    }    public String getimageUrl() {        return imageUrl;    }    public void setimageUrl(String image) {        this.imageUrl = image;    }    public String getArticleUrl() {        return articleUrl;    }    public void setArticleUrl(String articleurl) {        this.articleUrl = articleurl;    }    @Override    public String toString() {        return "StrategyArticle{" +                "articleId='" + articleId + '\'' +                ", title='" + title + '\'' +                ", time='" + time + '\'' +                ", readCount=" + readCount +                ", imageUrl='" + imageUrl + '\'' +                ", articleUrl='" + articleUrl + '\'' +                '}';    }}